INSERT INTO `notice`
VALUES (3, '教师发展中心】教学一对一咨询预约服务', '<p>教学一对一咨询预约服务</p>', 'linc', '2022-04-16 18:18:09', '2022-04-16 18:18:09');
INSERT INTO `notice`
VALUES (4, '【教师发展中心】【课程思政】课程思政三问', '<p>课程思政三问</p>', 'linc', '2022-04-16 18:18:29', '2022-04-16 18:18:29');
INSERT INTO `notice`
VALUES (5, '【百家大讲堂】第361期：流-固-声耦合系统研究及应用',
        '<h3>清晰</h3><p>清晰包括两个层面，结构清晰与内容清晰。</p><p>结构清晰：数据可视化呈现的是一幅作品，它是制作者分析思路的呈现，其布局决定阅读者的浏览顺序。清晰的平面布局以及清晰的数据纵深路径能很好的帮助阅读者获取信息。下图展示一个经典的仪表盘设计布局，上方的筛选区从顶层决定画布区呈现的数据，右侧区默认展示画布区的汇总信息，画布上激活数据点时，右侧则更新显示明细数据。</p>',
        'linc', '2022-04-16 18:22:47', '2022-04-16 18:22:47');
INSERT INTO `notice`
VALUES (6, '2022年度国家社会科学基金项目申报公告',
        '<p>数据可视化 AntV 的设计原则是基于&nbsp;<a href=\"https://ant.design/docs/spec/introduce-cn\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(135, 59, 244);\">Ant Design</a>&nbsp;设计体系衍生的，具有数据可视化特性的指导原则。它在遵循 Ant Design 设计价值观的同时，对数据可视化领域的进一步解读，如色板、字体的指引。</p><p>AntV 经过大量的项目实战经验，总结了四条核心原则：准确、清晰、有效、美，这四条原则按重要等级先后排序，相辅相成且呈递进关系。</p><p><br></p><h3><br></h3>',
        'linc', '2022-04-16 18:23:00', '2022-04-16 18:23:00');
INSERT INTO `notice`
VALUES (7, '2022年度国家社会科学基金项目申报公告', '2022年度国家社会科学基金项目申报公告', 'linc', '2022-04-16 18:23:00', NULL);
